INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES ('2', '1', '2015-06-17 07:09:34', '2015-06-17 07:09:34', '[tx_row]\r\n[tx_column size=\"1/2\"]\r\n<h1>Caravan Sales Perth WA</h1>\r\nNew caravan sales Perth WA and New Caravan Sales Darwin NT, Australia of VERY tough off road big caravan sales for rugged outback Western Australian and Northern Territory conditions. <em>DownunderRV Caravans</em> manufacturer high quality caravans suited for WA and NT travelers, caravan park homes and mine workers at mining camps and mining towns of WA. Dream homes on wheels.\r\n\r\nVisit our big new and used caravan display centre in Mandurah, near Perth. <em>DownunderRV</em> Caravan sales can tailor make or modify caravans to your specifications.\r\n\r\nSmall single axle caravans, BIG tandem axle caravans, and Full Off-road Caravans sales WA and NT Australia.\r\n\r\n[/tx_column]\r\n[tx_column size=\"1/2\"]\r\n\r\n<object width=\"450\" height=\"280\" classid=\"clsid:d27cdb6e-ae6d-11cf-96b8-444553540000\" codebase=\"http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0\"><embed type=\"application/x-shockwave-flash\" src=\"http://www.youtube.com/v/LK2hG6lkkMU?version=3&amp;hl=en_US&amp;rel=0\" allowfullscreen=\"allowfullscreen\" allowscriptaccess=\"always\" height=\"280\" width=\"450\" /></object>\r\n\r\n[/tx_column]\r\n[/tx_row]\r\n\r\n<em>Downunder RV Caravans</em> is one of WAs most respected caravan sales companies in Western Australia, and the Northern Territory, specialising in quality on-road and semi off-road caravans. Owners <em>Christine</em> and <a href=\"https://plus.google.com/b/102362184925792905778/112816207883317051256\"><em>Tom Spry</em></a> have spent many years caravanning around Australia so they understand the needs of their caravanning clients and are happy to share Australian caravan knowledge for Australian conditions with other caravanners.\r\n\r\nOur WA caravan sales and display centre is at <em>Mandurah</em> Western Australia, just 1 hour drive south of Perth, where youll find a huge selection of quality new caravans for sale and used caravans for sale from Australias leading caravan brands including <em>Downunder Caravans</em>, <em>Universal</em><em>Caravans</em> and <em>Roadstar Caravans</em>. We can customise caravans to suit buyer needs and budget. Our quality built <i>Australian</i> caravan range also offers a wide variety of on-road and semi off-road caravans, which can be customised to suit. <a href=\"http://www.caravanperth.com/downunder-rv/\">About DownUnder RV Caravans..</a>\r\n\r\n[tx_divider size=\"24\"]\r\n\r\n[tx_calltoact button_text=\"Know More..\" url=\"#\"]Call To Act Text[/tx_calltoact]\r\n\r\n[tx_blog items=\"4\" columns=\"4\" showcat=\"hide\" category_id=\"\" show_pagination=\"no\" carousel=\"no\"]', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2015-06-18 09:10:46', '2015-06-18 09:10:46', '', '0', 'http://webdesignmalaysia.net/caravan/?page_id=2', '0', 'page', '', '0'),/*BUP_EOL*/('4', '1', '2015-06-17 07:12:21', '2015-06-17 07:12:21', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been 