', '1', '2015-06-17 08:55:13', '2015-06-17 08:55:13', '<h1>Caravan Sales Perth WA</h1>\r\nNew caravan sales Perth WA and New Caravan Sales Darwin NT, Australia of VERY tough off road big caravan sales for rugged outback Western Australian and Northern Territory conditions. <em>DownunderRV Caravans</em> manufacturer high quality caravans suited for WA and NT travelers, caravan park homes and mine workers at mining camps and mining towns of WA. Dream homes on wheels.\r\n\r\nVisit our big new and used caravan display centre in Mandurah, near Perth. <em>DownunderRV</em> Caravan sales can tailor make or modify caravans to your specifications.\r\n\r\nSmall single axle caravans, BIG tandem axle caravans, and Full Off-road Caravans sales WA and NT Australia.\r\n\r\n<object width=\"450\" height=\"280\" classid=\"clsid:d27cdb6e-ae6d-11cf-96b8-444553540000\" codebase=\"http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0\"><embed type=\"application/x-shockwave-flash\" src=\"http://www.youtube.com/v/LK2hG6lkkMU?version=3&amp;hl=en_US&amp;rel=0\" allowfullscreen=\"allowfullscreen\" allowscriptaccess=\"always\" height=\"280\" width=\"450\" /></object>\r\n\r\n<em>Downunder RV Caravans</em> is one of WAs most respected caravan sales companies in Western Australia, and the Northern Territory, specialising in quality on-road and semi off-road caravans. Owners <em>Christine</em> and <a href=\"https://plus.google.com/b/102362184925792905778/112816207883317051256\"><em>Tom Spry</em></a> have spent many years caravanning around Australia so they understand the needs of their caravanning clients and are happy to share Australian caravan knowledge for Australian conditions with other caravanners.\r\n\r\nOur WA caravan sales and display centre is at <em>Mandurah</em> Western Australia, just 1 hour drive south of Perth, where youll find a huge selection of quality new caravans for sale and used caravans for sale from Australias leading caravan brands including <em>Downunder Caravans</em>, <em>Universal</em><em>Caravans</em> and <em>Roadstar Caravans</em>. We can customise caravans to suit buyer needs and budget. Our quality built <i>Australian</i> caravan range also offers a wide variety of on-road and semi off-road caravans, which can be customised to suit. <a href=\"http://www.caravanperth.com/downunder-rv/\">About DownUnder RV Caravans..</a>', 'Home', '', 'inherit', 'open', 'open', '', '2-revision-v1', '', '', '2015-06-17 08:55:13', '2015-06-17 08:55:13', '', '2', 'http://webdesignmalaysia.net/caravan/index.php/2015/06/17/2-revision-v1/', '0', 'revision', '', '0'),/*BUP_EOL*/('45', '1', '2015-06-17 09:14:04', '2015-06-17 09:14:04', '', 'page', '', 'inherit', 'open', 'open', '', 'page', '', '', '2015-06-17 09:14:04', '2015-06-17 09:14:04', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2015/06/page.jpeg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('49', '1', '2014-04-15 07:10:35', '2014-04-15 07:10:35', '', 'Safari-tamar-20ft-013', '', 'inherit', 'closed', 'open', '', 'safari-tamar-20ft-013', '', '', '2014-04-15 07:10:35', '2014-04-15 07:10:35', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/04/Safari-tamar-20ft-013.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('50', '1', '2014-04-15 07:10:36', '2014-04-15 07:10:36', '', 'used-caravans-perth-cat', '', 'inherit', 'closed', 'open', '', 'used-caravans-perth-cat', '', '', '2014-04-15 07:10:36', '2014-04-15 07:10:36', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/04/used-caravans-perth-cat.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('51', '1', '2014-04-15 07:10:36', '2014-04-15 07:10:36', '', 'downunderrv-caravan2', '', 'inherit', 'closed', 'open', '', 'downunderrv-caravan2', '', '', '2014-04-15 07:10:36', '2014-04-15 07:10:36', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/04/downunderrv-caravan2.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('