per light Composite fibreglass walls, ceiling and floor, keep the Blue Heeler warm in winter and cool in summer. For when the temperature is more extreme, simply turn on the reverse cycle air conditioner that is neatly perched on the ultra strong welded box section moulded fiberglass cladded roof with 50mm of insulation. Double glazed tinted windows are standard. Rain, hail or shine the Blue Heeler is ready for whatever nature throws at it.\n\nBlue Heeler is feature packed with state of the art electronics and quality appliances that will impress even the most fastidious purchasers. The list of standard features are sure to impress.\n\nStorage is in abundance with the Gas Bottle, Generator (on a slide) and fuel compartment in the oversized extreme fully lockable toolbox.\n\nA new range of sizes from 186 to 216 are available with new designs that can cater for the family, with a new smart new bi-fold table that converts into a bed.\n\nPRICE ON APPLICATION\nPrice: $0.00', 'Sunland Blue Heeler', '', 'publish', 'closed', 'open', '', 'sunland-blue-heeler', '', '', '2014-04-15 09:55:32', '2014-04-15 09:55:32', '', '0', 'http://www.caravanperth.com/?p=273', '0', 'post', '', '0'),/*BUP_EOL*/('274', '1', '2014-04-15 09:54:16', '2014-04-15 09:54:16', '', 'thumbs_blue-heeler-007', '', 'inherit', 'closed', 'open', '', 'thumbs_blue-heeler-007', '', '', '2014-04-15 09:54:16', '2014-04-15 09:54:16', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/04/thumbs_blue-heeler-007.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('275', '1', '2014-04-15 09:54:33', '2014-04-15 09:54:33', '', 'thumbs_dsc8721', '', 'inherit', 'closed', 'open', '', 'thumbs_dsc8721', '', '', '2014-04-15 09:54:33', '2014-04-15 09:54:33', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/04/thumbs_dsc8721.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('276', '1', '2014-04-15 09:54:34', '2014-04-15 09:54:34', '', 'thumbs_blue-heeler-007', '', 'inherit', 'c