_lro22-8', '', 'inherit', 'closed', 'open', '', 'thumbs_lro22-8', '', '', '2014-04-15 09:59:56', '2014-04-15 09:59:56', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/04/thumbs_lro22-8.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('335', '1', '2014-04-15 09:59:57', '2014-04-15 09:59:57', '', 'thumbs_lro22-22', '', 'inherit', 'closed', 'open', '', 'thumbs_lro22-22', '', '', '2014-04-15 09:59:57', '2014-04-15 09:59:57', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/04/thumbs_lro22-22.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('336', '1', '2014-04-15 10:11:28', '2014-04-15 10:11:28', '<img class=\"alignnone size-full wp-image-337\" alt=\"thumbs_patriots\" src=\"http://www.caravanperth.com/wp-content/uploads/2014/04/thumbs_patriots.jpg\" width=\"640\" height=\"480\" />\n\nThe Patriot S continues to shine as an example of what can be created when listening to customers requirements. One example of this is the ATM, from 2500kg it can be towed by most medium sized four wheel drives.\n\nThis is a truly unique caravan, tough enough to handle the extreme Australian conditions whilst providing quality creature comforts, with its modern styling, its in a class of its own. The choice of superb timber or fabulous high gloss 2 pac finishes will make you the envy of all caravan enthusiasts.\n\nThe Patriot S has a light weight composite chassis, box section welded aluminium frame and cruisemaster independent coil suspension including a total of 8 shock absorbers , 15 alloy wheels with 10 drums.\n\nInsulation in the floor, walls and roof keep the Patriot warm in winter and cool in summer. For when the temperature is more extreme, simply turn on the reverse cycle air conditioner that is neatly perched on the ultra strong moulded fibre glass roof. The 125 litre 8mm poly water tank in conjunction with food grade soft pipe plumbing adds protection from damaging stones when travelling off road.\n\nComfort and security are only two of the main attractions with the Patriot S, durability and quality is in abundance as well. Standard features such as the entertainment unit\ncomprising of DVD/CD/MP3/RADIO with USB input and 22 LED TV ensures you are always kept entertained.\n\nThe desirable en-suite has plenty of room to move, with a separate shower and toilet.\n\nThis is a truly unique caravan, tough enough to handle the extreme Australian conditions whilst providing quality creature comforts.\n\nThe ceramic above bench vanity and well lit mirror are user friendly and stylish.\n\nFull size queen and single bed configurations are available to suit the individuals needs and tastes. Ample storage is provided in large wardrobes and under the bed. All wiring and plumbing is neatly tucked away emphasising attention to detail and allowing maximum cupboard space.\n\nOne 200watt solar panel along with a single 100AGM battery guarantees the Patriot always has copious amounts of power. The modern kitchen features a gas/electric stove with grill, stainless steel range hood and a customised fibreglass sink complimented with a high end laminate bench top and splash back. The 184L refrigerator takes advantage of the latest 3 way technology and provides versatile options.\n\nA tri-fold table is now available with a bed seat conversion that emphasises the form and function of the new Patriot S.\n\nPRICE ON APPLICATION\nPrice: $0.00', 'Sunland The Patriot S', '', 'publish', 'closed', 'open', '', 'sunland-the-patriot-s', '', '', '2014-04-15 10:11:28', '2014-04-15 10:11:28', '', '0', 'http://www.caravanperth.com/?p=336', '0', 'post', '', '0'),/*BUP_EOL*/('337', '1', '2014-04-15 10:10:51', '2014-04-15 10:10:51', '', 'thumbs_patriots', '', 'inherit', 'closed', 'open', '', 'thumbs_patriots', '', '', '2014-04-15 10:10:51', '2014-04-15 10:10:51', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/04/thumbs_patriots.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('338', '1', '2014