lass vanity and well lit mirror is user friendly and stylish.\n\nFull size queen and single bed configurations are available to suit the individuals needs and tastes.\n\nAmple storage is provided in large wardrobes and under the bed. All wiring and plumbing is neatly tucked away emphasising attention to detail and allowing maximum cupboard space.\n\nA 200watt solar panel along with a single 100AGM battery guarantees the Patriot always has copious amounts of power.\n\nThe modern kitchen features a gas/electric stove with grill, stainless steel range hood and a customised fibreglass sink complimented with a high end laminate bench top and Akril splash back. The 184L refrigerator takes advantage of the latest 3 way technology and provides versatile options.\n\nA tri-fold table is now available with a bed seat conversion that emphasises the form and function of the new Patriot SE\n\nPRICE ON APPLICATION\nPrice: $0.00', 'Sunland Patriot SE', '', 'publish', 'closed', 'open', '', 'sunland-patriot-se', '', '', '2014-04-15 10:13:34', '2014-04-15 10:13:34', '', '0', 'http://www.caravanperth.com/?p=351', '0', 'post', '', '0'),/*BUP_EOL*/('352', '1', '2014-04-15 10:13:04', '2014-04-15 10:13:04', '', 'thumbs_se1', '', 'inherit', 'closed', 'open', '', 'thumbs_se1', '', '', '2014-04-15 10:13:04', '2014-04-15 10:13:04', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/04/thumbs_se1.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('353', '1', '2014-04-15 10:13:15', '2014-04-15 10:13:15', '', 'thumbs_se4', '', 'inherit', 'closed', 'open', '', 'thumbs_se4', '', '', '2014-04-15 10:13:15', '2014-04-15 10:13:15', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/04/thumbs_se4.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('354', '1', '2014-04-15 10:13:17', '2014-04-15 10:13:17', '', 'thumbs_se5', '', 'inherit', 'closed', 'open', '', 'thumbs_se5', '', '', '2014-04-15 10:13:17', '2014-04-15 10:13:17', '', '0', 'http://webdesignmala