ly Screens and Block out Blinds, Large Ensuite with separate Shower and Toilet, Full Fibre Glass Shower, Leather Pockets Built into Bed Head, Smoke &amp; Gas Alarm, Triple dead lock entrance door, Door privacy curtain, Lift up bed base, Concerntina Door for Ensuite, Stainless Steel Entrance Handle, Modern Kitchen.\n\n2x 200 watt Solar Panels, Solar Regulator, Battery Charger, 2x LiFe Batteries, 240v Inlet with safety Switch, Exterior 240v Outlet under Awning, Andersen Plug.\n\n190 ltr General Purpose Water Tank, 60ltr Filtered Drinking Water Tank, Dometic CTS 4110 Toilet, Shower Rose with Flick Mixer, Sink in Galley with Flick Mixer, Fibre Glass Vanity Sink with Flick Mixer, Suburban or Continuous Hot Water System, External Rain Water Catchment, Rear tap, Full Fibre Glass Shower with exclusive drain\n\nLight weight Composite Chassis, Box Section Welded Aluminium Frame, 3.3T Cruise Master Independent Coil Suspension, 8 Shock Absorbers, 12 Brakes (ESC Compatable), Raptor Coating Protection Front, Rear and Sides, Moulded Full Fibre Glass Exterior, Composite Fibre Glass Floor, Insulation in Roof, Floor and Walls, No Step Well.\n\nBed Spread, Awning Arm Covers, 2x Scatter Cushions, Tv Storage Bag, Microwave Plate Storage Bag, Spare Wheel Cover.\n\nBottle Jack, Drinking water filler hose, Hose fittings, Sullage Hoses, 15 amp power lead\n\nIts Magnificent  Has to be seen to believe !\n\nQUEEN OF THE DOWNUNDER FLEET\n\n*All Specifications are as per standard caravan, and may not apply to displayed caravan\n\nPrice: $0.00', 'Sunland Patriot SE-L 2014', '', 'publish', 'closed', 'open', '', 'sunland-patriot-se-l-2014-2', '', '', '2014-06-09 07:40:49', '2014-06-09 07:40:49', '', '0', 'http://www.caravanperth.com/?p=1628', '0', 'post', '', '0'),/*BUP_EOL*/('1629', '1', '2014-06-09 07:39:43', '2014-06-09 07:39:43', '', 'Sunland Patriot SE-L 2014', '', 'inherit', 'closed', 'open', '', 'sony-dsc-439', '', '', '2014-06-09 07:39:43', '2014-06-09 07:39:43', '', '0', 'http://webdesignm