'0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('1901', '1', '2014-08-04 16:28:45', '2014-08-04 08:28:45', '', 'SONY DSC', '', 'inherit', 'closed', 'open', '', 'sony-dsc-559', '', '', '2014-08-04 16:28:45', '2014-08-04 08:28:45', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/08/DSC07100.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('1911', '1', '2014-08-07 16:15:57', '2014-08-07 08:15:57', '', 'SONY DSC', '', 'inherit', 'closed', 'open', '', 'sony-dsc-560', '', '', '2014-08-07 16:15:57', '2014-08-07 08:15:57', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/08/DSC07103.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('1918', '1', '2014-08-14 11:30:49', '2014-08-14 03:30:49', '<img class=\"alignnone wp-image-1919 \" src=\"http://www.caravanperth.com/wp-content/uploads/2014/08/gallery414-1.jpg\" alt=\"gallery414 (1)\" width=\"754\" height=\"448\" />\n\nOnce in a while, a van comes along with a price that makes you do a double-take.\nWell, the Platoon X-Trail aims to be just such a van with a price thats almost too good to be true.\nThe Platoon is a fully off-road capable, 196, dual-axle van.\nIts perfect for those who arent necessarily dedicated off-road adventurers, but want the peace of mindof a van that can handle almost anything.\n\nLets see exactly what it is that makes the Platoon such a great van and such great value for money:\n<ul style=\"color: #000000;\">\n	<li>Cruisemaster 3700kg independent coil suspension. You get the same top-of-the-line suspension as used\non the toughest of off-roaders.</li>\n	<li>Twin everything for independent camping. 2x95L of water, 2x100A batteries, 2x9kg gas, 2x150W solar\npanels, 2 jerry cans, 2 spare wheels</li>\n	<li>Rock-solid platform. 6-inch Austrail chassis with a Hyland hitch</li>\n	<li>Aussie built. Kokoda vans are built in Australia for Australian conditions</li>\n	<li>Creature comforts. Ibis reverse-cycle air conditioning, tri-fold table, innerspring mattress, washing machine,\nSwift ovenmini-grill, 175L Waeco 12V compressor 2-door fridge, double-glazed windows</li>\n	<li>Theres no doubt that the Platoon X-Trail is a van built for strength and independence. You can stop worrying\nabout the condition of the roads and start thinking about how long you want to stay  because with twin solar,\nbatteries, gas and water tanks that could be a very long time.</li>\n</ul>\nGreat Value at $64,990!!', 'Kokoda Platoon X-Trail 19.6ft', '', 'publish', 'closed', 'open', '', 'kakoda-platoon-x-trail-19-6ft', '', '', '2014-08-14 11:30:49', '2014-08-14 03:30:49', '', '0', 'http://www.caravanperth.com/?p=1918', '0', 'post', '', '0'),/*BUP_EOL*/('1919', '1', '2014-08-14 11:28:42', '2014-08-14 03:28:42', '', 'Kakoda Platoon X-Trail 19.6ft', '', 'inherit', 'closed', 'open', '', 'gallery414-1', '', '', '2014-08-14 11:28:42', '2014-08-14 03:28:42', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/08/gallery414-1.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('1920', '1', '2014-08-14 11:29:02', '2014-08-14 03:29:02', 'Kakoda Platoon X-Trail 19.6ft', 'Kakoda Platoon X-Trail 19.6ft', '', 'inherit', 'closed', 'open', '', 'gallery424', '', '', '2014-08-14 11:29:02', '2014-08-14 03:29:02', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/08/gallery424.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('1921', '1', '2014-08-14 11:29:12', '2014-08-14 03:29:12', '', 'gallery414 (1)', '', 'inherit', 'closed', 'open', '', 'gallery414-1-2', '', '', '2014-08-14 11:29:12', '2014-08-14 03:29:12', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/08/gallery414-11.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('1922', '1', '2014-08-14 11:29:21', '2014-08-14 03:29:21', '', 'gallery415', '', 'inherit', 'closed', 'open', '', 'gallery415', '', '', '2014-08-14 11:29:21', '2014-08-14 03:29:21', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/08/gallery