12-19 12:06:23', '2014-12-19 04:06:23', '', 'SONY DSC', '', 'inherit', 'closed', 'open', '', 'sony-dsc-882', '', '', '2014-12-19 12:06:23', '2014-12-19 04:06:23', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/12/DSC07537.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('2552', '1', '2014-12-24 13:32:13', '2014-12-24 05:32:13', '', 'Caravan Perth KOKODA PLATOON X-TRAIL', '', 'inherit', 'closed', 'open', '', 'caravan-perth-kokoda-platoon-x-trail', '', '', '2014-12-24 13:32:13', '2014-12-24 05:32:13', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/10/Caravan-Perth-KOKODA-PLATOON-X-TRAIL.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('2555', '1', '2014-12-24 13:40:07', '2014-12-24 05:40:07', '', 'Caravan Perth SALUTE PLATINUM  SEMI OFF ROAD', '', 'inherit', 'closed', 'open', '', 'caravan-perth-salute-platinum-semi-off-road', '', '', '2014-12-24 13:40:07', '2014-12-24 05:40:07', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2014/09/Caravan-Perth-SALUTE-PLATINUM-SEMI-OFF-ROAD.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('2569', '1', '2015-01-12 09:48:00', '2015-01-12 01:48:00', '<p style=\"text-align: left;\"><img class=\"alignnone wp-image-2602 size-full\" src=\"http://webdesignmalaysia.net/caravan/wp-content/uploads/2015/01/DSC072151.jpg\" alt=\"SONY DSC\" width=\"640\" height=\"360\" /></p>\r\n<p style=\"text-align: left;\"><strong>TRIBUTE PLATINUM</strong></p>\r\n<p style=\"text-align: left;\" align=\"center\"><strong>SEMI OFF ROAD</strong></p>\r\n<p style=\"text-align: left;\" align=\"center\">ATM 2710 Tare 2310 GTM 2529 Ball 181 SN:COSY14164</p>\r\n<p style=\"text-align: left;\">Kokoda challenges you to find a better value for money semi-off road van than the Tribute Series II Platinum. The Tribute Series II Platinum comes as well appointed as many standard vans that cost thousands more.</p>\r\n<p style=\"text-align: left;\">For an affordable price you get premium features such as semi-off road simplicity suspension,\r\nso you can travel our beautiful country knowing your suspension is off-road capable!</p>\r\n<p style=\"text-align: left;\">Internal Features: Front full queen island bed, Cafe dinette &amp; tri-fold table, LED down lights, Ibis reverse cycle air conditioner, Microwave, 19 digital TV/CD/DVD/MP3 player, Full oven, 184Ltr 2 door 3 way fridge, Full ensuite with ceramic vanity, Fully moulded shower, 2.2Ltr washing machine, Full height kitchen splash back, Frosted overhead doors, Drawers on rollers, Bench top over stove, Rolled bench tops, Flick mixer taps, Piano hinges, Push button handles, Linen cupboard</p>\r\n<p style=\"text-align: left;\">External Features: E.S.C (Electronic Stability Control), Simplicity suspension, 1 x 150 watt solar panels &amp; regulator, 2 x 100ah deep cycle batteries, External shower, Gas / electric hot water service, 2 x 9kg gas bottles, 2 x 22.6Ltr gas / electric hot water system, 2 x 95Ltr water tanks withgalvanised - stone guard, Picnic table, Generator hatch, Jack antenna, 2 x outside speakers, Dometic double glazed windows, 6 Austrail chassis, 2 spare wheels, Off-road tyres, 2 x jerry can holders, Hyland hitch, Platinum silver cladding.</p>\r\n<p style=\"text-align: left;\" align=\"center\">$64,990 Drive Away inc GST and 12 mths Rego</p>', 'TRIBUTE PLATINUM  SEMI OFF ROAD 20.6FT COSY14164', '', 'publish', 'closed', 'open', '', 'tribute-platinum-semi-off-road-20-6ft', '', '', '2015-06-18 05:50:58', '2015-06-18 05:50:58', '', '0', 'http://www.caravanperth.com/?p=2569', '0', 'post', '', '0'),/*BUP_EOL*/('2570', '1', '2015-01-10 13:15:13', '2015-01-10 05:15:13', '', 'SONY DSC', '', 'inherit', 'closed', 'open', '', 'sony-dsc-883', '', '', '2015-01-10 13:15:13', '2015-01-10 05:15:13', '', '0', 'http://webdesignmalaysia.net/caravan/wp-content/uploads/2015/01/DSC07231.jpg', '0', 'attachment', 'image/jpeg', '0'),/*BUP_EOL*/('2571', '1', '2015-01-10 13:15:20', '2015-01-10 05:15:20', '', 'SONY DSC', 