edge for Australian conditions with other caravanners.\r\n\r\nOur WA caravan sales and display centre is at <em>Mandurah</em> Western Australia, just 1 hour drive south of Perth, where youll find a huge selection of quality new caravans for sale and used caravans for sale from Australias leading caravan brands including <em>Downunder Caravans</em>, <em>Universal</em><em>Caravans</em> and <em>Roadstar Caravans</em>. We can customise caravans to suit buyer needs and budget. Our quality built <i>Australian</i> caravan range also offers a wide variety of on-road and semi off-road caravans, which can be customised to suit. <a href=\"http://www.caravanperth.com/downunder-rv/\">About DownUnder RV Caravans..</a>', 'Home2', '', 'publish', 'closed', 'closed', '', 'home-2', '', '', '2015-07-02 05:58:50', '2015-07-02 05:58:50', '', '0', 'http://webdesignmalaysia.net/caravan/index.php/home-2/', '1', 'page', '', '0'),/*BUP_EOL*/('2894', '1', '2015-06-17 10:46:49', '2015-06-17 10:46:49', '<div class=\"art-content-layout\">\r\n<div class=\"art-content-layout-row\">\r\n<div class=\"art-layout-cell\" style=\"width: 100%;\">\r\n<h3>MEGA STOCK CLEARANCE SALE!! Caravans for Sale in Perth &amp; Mandurah WA</h3>\r\nWe are OVERSTOCKED and are having a MEGA STOCK SALE!! For a limited time only  BE QUICK AND SAVE!!!\r\nDownunder\r\nRV is one of WAs most respected caravan sales companies in Western\r\nAustralia, and the Nothern Territory, specialising in quality on-road\r\nand semi off-road caravans. Owners Christine and Tom have spent many\r\nyears caravanning around Australia so they understand the needs of their\r\ncaravanning clients and are happy to share their Australian caravan\r\nknowledge for Australian conditions with other caravanners.\r\n\r\nOur\r\nWA Caravan display and sales centre is located in Mandurah Western\r\nAustralia, just 1 hour drive south of Perth. Its where youll find a\r\nhuge selection of quality new and used caravans for sale from\r\nAustralias leading caravan brands including Downunder, Westerns and\r\nRoadstar.\r\nOur Downunder range of caravan sales are built by Vanguard\r\nCaravans, an ISO Quality Assured accredited caravan builder with an\r\nexcellent reputation for building quality custom manufactured caravans.\r\n\r\nThis\r\nprovides peace of mind for our caravan buying customers and also means\r\nwe can customise caravans to suit your needs and budget.\r\nOur great quality built Aussie Wide caravan range also offers a\r\nwide variety of on-road and semi off-road caravans, which can be\r\ncustomised to suit.\r\n<h3>10 Reasons Why Western Australians Choose Downunder RV Caravans:</h3>\r\n<ol>\r\n	<li>We stock a huge selection of new and used caravans to suit all tastes and budgets.</li>\r\n	<li>Our\r\nDownunder and Aussie Wide range of caravans delivers quality\r\nconstruction and innovative caravan design; theres a layout to suit\r\nalmost everyones taste.</li>\r\n	<li>We listen to your caravanning needs and do all we can to find you the perfect caravan.</li>\r\n	<li>We can help you customise your caravan to meet your requirements.</li>\r\n	<li>We check your tow vehicle to ensure you choose the right caravan  and that its legal, safe and matched to your caravan.\r\nWe offer friendly, helpful caravan advice  and guarantee, no pushy sales people.</li>\r\n	<li>We stock Australias biggest caravan brand names including: Aussie Wide, Downunder</li>\r\n	<li>Our\r\nimpressive Mandurah caravan showroom features an undercover display\r\narea plus a huge outdoor display area. Our caravan showroom is\r\nair-conditioned for your comfort and we provide a convenient colour\r\nconsultancy service.We even put the kettle on for tea and coffee, so\r\nyou can relax and enjoy your visit. Youll also find plenty of easy\r\nparking for cars with vans too!</li>\r\n	<li>We can put you in touch with CIL Caravan and RV Insurance for your caravan.</li>\r\n	<li>We can help you sell your caravan by placing it in our yard on consignment.</li>\r\n	<l