:00', '2015-06-17 10:47:00', '<p>Used Caravans For Sale in Perth.<br></p>', 'Used Caravans For Sale Perth', '', 'publish', 'closed', 'open', '', 'used-caravans-perth', '', '', '2015-06-17 10:47:00', '2015-06-17 10:47:00', '', '0', 'http://webdesignmalaysia.net/caravan/index.php/used-caravans-perth/', '13', 'page', '', '0'),/*BUP_EOL*/('2906', '1', '2015-06-17 10:47:01', '2015-06-17 10:47:01', '<p>Caravan Deals Super Specials<br></p>', 'Caravan Deals Super Specials', '', 'publish', 'closed', 'open', '', 'caravan-deals-super-specials', '', '', '2015-06-17 10:47:01', '2015-06-17 10:47:01', '', '0', 'http://webdesignmalaysia.net/caravan/index.php/caravan-deals-super-specials/', '14', 'page', '', '0'),/*BUP_EOL*/('2907', '1', '2015-06-17 10:47:02', '2015-06-17 10:47:02', '<p><img width=\"511\" height=\"280\" alt=\"\" src=\"http://webdesignmalaysia.net/caravan/wp-content/uploads/2015/06/downunderrv-caravan2.jpg\" style=\"margin-left: 0px; \" class=\"art-lightbox\"><img width=\"511\" height=\"280\" alt=\"\" class=\"art-lightbox\" src=\"http://webdesignmalaysia.net/caravan/wp-content/uploads/2015/06/downunderrv-caravan3.jpg\" style=\"margin-left: 10px; \"></p><p>Downunder RV is one of WAs most respected caravan sales companies in Western Australia, and the Nothern Territory, specialising in quality on-road and semi off-road caravans. Owners Christine and Tom have spent many years caravanning around Australia so they understand the needs of their caravanning clients and are happy to share their Australian caravan knowledge for Australian conditions with other caravanners. <a href=\"http://webdesignmalaysia.net/caravan/index.php/downunder-rv/clients-testimonials/\">Clients testimonials.</a><br></p><p>New caravan sales Perth WA and New Caravan Sales Darwin NT, VERY tough off road big caravan sales for rugged outback Western Australian and Northern Territory conditions. DownunderRV Caravans manufacturer high quality caravans suited for WA and NT travelers, caravan park homes and mine workers at mining camps and mining towns of WA. Visit our big new and used <a href=\"http://webdesignmalaysia.net/caravan/index.php/contact/\">caravan display centre in Mandurah, near Perth</a>.&nbsp;</p><p>DownunderRV Caravan sales can tailor make or modify caravans to your specifications. Small single axle caravans, BIG tandem axle caravans, and Full Off-road Caravans sales WA and NT. <a href=\"http://webdesignmalaysia.net/caravan/index.php/downunder-rv/caravan-tips/\">Caravans tips.</a><br></p><p>Downunder RV sells caravans Western Australia wide and with a caravan sales company retail display shop in the Northern Territory of Australia, provides caravan sales and support to the Kimberley and northern Australia. <a href=\"http://webdesignmalaysia.net/caravan/index.php/downunder-rv/caravan-videos-western-australia/\">View presentation video.</a><br></p><p>New caravans sales Australia wide are covered by a 1 year warrantee by our after sales caravan service and repair team. <a href=\"http://webdesignmalaysia.net/caravan/index.php/downunder-rv/why-choose-us/\">Why choose us?</a><br></p><p>Visit our caravans sales office in Maundurah, south of the Swan River Perth, 100 Pinjarra Rd Mandurah ( opposite Ford) or our caravan sales agent in Broome and Darwin. <a href=\"/downunder-rv/latest-news\">Read our latest news.</a><br></p><p>Open MONDAY  FRIDAY 8.30  5pm, SATURDAY 8.30  4pm to see a range of caravans for sales and bargain caravan sales deals on selected caravan stock items and accessories.<br></p>', 'Downunder RV', '', 'publish', 'closed', 'open', '', 'downunder-rv', '', '', '2015-06-17 10:47:23', '2015-06-17 10:47:23', '', '0', 'http://webdesignmalaysia.net/caravan/index.php/downunder-rv/', '15', 'page', '', '0'),/*BUP_EOL*/('2908', '1', '2015-06-17 10:47:03', '2015-06-17 10:47:03', '<p>Caravans for Sale in Perth and Mandurah, WA</p><p>Downunder RV is one of WAs most respected caravan sales companies in Western Australia, and the Nothern Territory, specialising in quality on-road and semi off-road caravans. Owners Christine and Tom have spent many years caravanning around Australia so they understand the needs of their caravanning clients and are happy to share their Australian caravan knowledge for Australian conditions with other caravanners.<br></p><p>Our WA Caravan display and sales centre is located in Mandurah Western Australia, just 1 hour drive south of Perth. Its where youll find a huge selection of quality new and used caravans for sale from Australias leading caravan brands including Downunder, Westerns and Roadstar.<br></p><p>Our Downunder range of caravan sales are built by Vanguard Caravans, an ISO Quality Assured accredited caravan builder with an excellent reputation for building quality custom manufactured caravans.<br></p><p>This provides peace of mind for our caravan buying customers and also means we can customise caravans to suit your needs and budget.&nbsp;Our great quality built Aussie Wide caravan range also offers a wide variety of on-road and semi off-road caravans, which can be customised to suit.</p><p><br></p><h5>10 Reasons Why Western Australians Choose Downunder RV Caravans:<br></h5><ol><li>We stock a huge selection of new and used caravans to suit all tastes and budgets.<br></li><li>Our Downunder and Aussie Wide range of caravans delivers quality construction and innovative caravan design; theres a layout to suit almost everyones taste.<br></li><li>We listen to your caravanning needs and do all we can to find you the perfect caravan. We can help you customise your caravan to meet your requirements.<br></li><li>We check your tow vehicle to ensure you choose the right caravan  and that its legal, safe and matched to your caravan.<br></li><li>We offer friendly, helpful caravan advice  and guarantee, no pushy sales people.<br></li><li>We stock Australias biggest caravan brand names including: Aussie Wide, Downunder<br></li><li>Our impressive Mandurah caravan showroom features an undercover display area plus a huge outdoor display area. Our caravan showroom is air-conditioned for your comfort and we provide a convenient colour consultancy service. We even put the kettle on for tea and coffee, so you can relax and enjoy your visit. Youll also find plenty of easy parking for cars with vans too!<br></li><li>We can put you in touch with CIL Caravan and RV Insurance for your caravan.<br></li><li>We can help you sell your caravan by placing it in our yard on consignment.<br></li><li>Downunder RV cares about our customers and we work hard to ensure your satisfaction even when youre on the road. Any caravan problems, just give us a call and well do our best to assist.</li></ol>', 'Why Choose Us', '', 'publish', 'closed', 'open', '', 'why-choose-us', '', '', '2015-06-17 10:47:03', '2015-06-17 10:47:03', '', '2907', 'http://webdesignmalaysia.net/caravan/index.php/downunder-rv/why-choose-us/', '16', 'page', '', '0'),/*BUP_EOL*/('2909', '1', '2015-06-17 10:47:04', '2015-06-17 10:47:04', '<p>Caravan Videos Western Australia<br></p><p>http://youtu.be/LK2hG6lkkMU<br></p><p>http://youtu.be/lVv8Ah5Uzmc<br></p><p>http://youtu.be/ws_V4x5xDbQ<br></p><p>http://youtu.be/TVO062xAt5k<br></p>', 'Caravan Videos Western Australia', '', 'publish', 'closed', 'open', '', 'caravan-videos-western-australia', '', '', '2015-06-17 10:47:04', '2015-06-17 10:47:04', '', '2907', 'http://webdesignmalaysia.net/caravan/index.php/downunder-rv/caravan-videos-western-australia/', '17', 'page', '', '0'),/*BUP_EOL*/('2910', '1', '2015-06-17 10:47:05', '2015-06-17 10:47:05', '<p>Read about what our happy clients have to say:</p><blockquote>New caravan sales Perth WA and New Caravan Sales Darwin NT, VERY tough \noff road big caravan sales for rugged outback Western Australian and \nNorthern Territory conditions.<br>- Nick &amp; Hanna&nbsp;</blockquote><p><br></p><blockquote>DownunderRV Caravans manufacturer high \nquality caravans suited for WA and NT travelers, caravan park homes and \nmine workers at mining camps and mining towns of WA.<br>- Peter &amp; family</blockquote>', 'DownUnder RV Clients Testimonials', '', 'publish', 'closed', 'open', '', 'clients-testimonials', '', '', '2015-06-17 10:47:05', '2015-06-17 10:47:05', '', '2907', 'http://webdesignmalaysia.net/caravan/index.php/downunder-rv/clients-testimonials/', '18', 'page', '', '0'),/*BUP_EOL*/('2911', '1', '2015-06-17 10:47:06', '2015-06-17 10:47:06', '<article class=\"art-post art-article\">\r\n<h2 class=\"art-postheader\"><a href=\"#\">Roadstar Range</a></h2>\r\n<div class=\"art-postcontent art-postcontent-0 clearfix\">\r\n\r\nCome into our yard and check out our new Roadstar range including the NEW ROADSTAR SAFARI TAMER.\r\n\r\nSuper Tough !! FULL OFF ROADER !!\r\n\r\n<img class=\"art-lightbox\" src=\"http://webdesignmalaysia.net/caravan/wp-content/uploads/2015/06/Safari-tamar-20ft-013.jpg\" alt=\"\" width=\"640\" height=\"360\" />\r\n\r\n</div>\r\n<div class=\"art-postmetadatafooter\">\r\n<div class=\"art-postfootericons art-metadata-icons\"><span class=\"art-postcategoryicon\">Category: No Category</span></div>\r\n</div>\r\n</article>', 'Caravan News In Perth', '', 'publish', 'closed', 'open', '', 'caravan-news-in-perth', '', '', '2015-07-01 15:39:57', '2015-07-01 15:39:57', '', '2907', 'http://webdesignmalaysia.net/caravan/index.php/downunder-rv/caravan-news-in-perth/', '19', 'page', '', '0'),/*BUP_EOL*/('2912', '1', '2015-06-17 10:47:07', '2015-06-17 10:47:07', '<p>Downunder RVs owners Tom and Christine spent many years caravanning around Australia before they settled in Mandurah and established their very own caravan centre.\n\n</p><p>Here, they share some of their helpful caravanning tips to ensure you get the most out of your caravan touring Australia experience.&nbsp;If you have some additional caravanning tips youd like to share, feel free to <a href=\"http://webdesignmalaysia.net/caravan/index.php/contact/\">email them to us</a>.</p><p><span style=\"font-weight: bold;\">Packing Caravans</span><br>Its important when loading your caravan that you put the heaviest items on the bottom of the van, above the wheels in the middle of the caravan.\n\nLighter items should be stored at the top across the length of the caravan; while medium weighted items should be distributed in the middle and both ends evenly.\n\n</p><p><span style=\"font-weight: bold;\">Plugs</span><br>Its easy for plugs to go missing. If you attach a small chain from your plug to the sink youll never lose it again.\n\n</p><p><span style=\"font-weight: bold;\">Caravan Fire Risk</span><br>Dont risk ruining your holiday; keep your fire extinguisher on board caravans and up to date for peace of mind.\n\n</p><p><span style=\"font-weight: bold;\">BBQs</span><br>Save time when barbequing at caravan parks by using baking paper on the BBQ plate. When youre finished you can simply throw away the paper, leaving the plate clean.\n\n</p><p><span style=\"font-weight: bold;\">Safe Towing Caravans</span><br>Downunder RV always checks what tow vehicle you have to make sure you get the right weighted van to suit your vehicle. This is to ensure your vehicle is both legal on-road when towing caravans and for your safety.<br></p>', 'Caravan Tips', '', 'publish', 'closed', 'open', '', 'caravan-tips', '', '', '2015-06-17 10:47:23', '2015-06-17 10:47:23', '', '2907', 'http://webdesignmalaysia.net/caravan/index.php/downunder-rv/caravan-tips/', '20', 'page', '', '0'),/*BUP_EOL*/('2913', '1', '2015-06-17 10:47:08', '2015-06-17 10:47:08', '<iframe src=\"https://maps.google.com.au/maps?f=q&amp;source=embed&amp;hl=en&amp;geocode=&amp;q=100+Pinjarra+Road,+Mandurah,+WA,+6210&amp;aq=0&amp;oq=100+Pinjarra+Road,+Mandurah+WA+6210&amp;sll=-25.335448,135.745076&amp;sspn=55.047272,107.138672&amp;ie=UTF8&amp;hq=&amp;hnear=100+Pinjarra+Rd,+Mandurah+Western+Australia+6210&amp;t=m&amp;ll=-32.525757,115.72732&amp;spn=0.025329,0.085831&amp;z=14&amp;iwloc=A&amp;output=embed\" width=\"100%\" height=\"300\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\r\n\r\nContact us or submit form for inquiries:\r\n\r\n[one_half]\r\n\r\n<span style=\"font-weight: bold;\">Our Address:</span>\r\n100 Pinjarra Road, Mandurah WA 6210\r\n\r\n<span style=\"font-weight: bold;\">Branch</span>\r\n<a href=\"http://webdesignmalaysia.net/caravan/index.php/contact/darwin-caravans/\">Darwin Caravans Showroom</a>\r\n<a href=\"http://webdesignmalaysia.net/caravan/index.php/contact/broome-caravans/\">Broome Caravans Showroom</a>\r\n\r\n[/one_half]\r\n\r\n[one_half_last]\r\n\r\n<span style=\"font-weight: bold;\">Phone</span>: 08 9534 9466\r\n\r\n<span style=\"font-weight: bold;\">Fax</span>: 08 9586 2677\r\n\r\n<span style=\"font-weight: bold;\">Mobile</span>: 0418 941 745\r\n\r\n<span style=\"font-weight: bold;\">Email</span>: sales@downunderrv.com.au\r\n\r\n[/one_half_last]\r\n<h5>Submit Form</h5>', 'Contact Down Under RV', '', 'publish', 'closed', 'open', '', 'contact', '', '', '2015-07-01 15:48:11', '2015-07-01 15:48:11', '', '0', 'http://webdesignmalaysia.net/caravan/index.php/contact/', '21', 'page', '', '0'),/*BUP_EOL*/('2914', '1', '2015-06-17 10:47:09', '2015-06-17 10:47:09', '<p>Darwin caravans for sale.</p><p>Page is being update.</p><p><a href=\"http://webdesignmalaysia.net/caravan/index.php/contact/\">Contact us</a> for inquiry.</p>', 'Darwin Caravans For Sale', '', 'publish', 'closed', 'open', '', 'darwin-caravans', '', '', '2015-06-17 10:47:23', '2015-06-17 10:47:23', '', '2913', 'http://webdesignmalaysia.net/caravan/index.php/contact/darwin-caravans/', '22', 'page', '', '0'),/*BUP_EOL*/('2915', '1', '2015-06-17 10:47:10', '2015-06-17 10:47:10', '<p>Broome Caravans For Sale.<br></p><p>Page is being update.</p><p><a href=\"http://webdesignmalaysia.net/caravan/index.php/contact/\">Contact us</a>&nbsp;for inquiry.</p>', 'Broome Caravans For Sale', '', 'publish', 'closed', 'open', '', 'broome-caravans', '', '', '2015-06-17 10:47:23', '2015-06-17 10:47:23', '', '2913', 'http://webd