=\"http://webdesignmalaysia.net/caravan/wp-content/uploads/2015/06/downunderrv-caravan2.jpg\" style=\"margin-left: 0px; \" class=\"art-lightbox\"><img width=\"511\" height=\"280\" alt=\"\" class=\"art-lightbox\" src=\"http://webdesignmalaysia.net/caravan/wp-content/uploads/2015/06/downunderrv-caravan3.jpg\" style=\"margin-left: 10px; \"></p><p>Downunder RV is one of WAs most respected caravan sales companies in Western Australia, and the Nothern Territory, specialising in quality on-road and semi off-road caravans. Owners Christine and Tom have spent many years caravanning around Australia so they understand the needs of their caravanning clients and are happy to share their Australian caravan knowledge for Australian conditions with other caravanners. <a href=\"http://webdesignmalaysia.net/caravan/index.php/downunder-rv/clients-testimonials/\">Clients testimonials.</a><br></p><p>New caravan sales Perth WA and New Caravan Sales Darwin NT, VERY tough off road big caravan sales for rugged outback Western Australian and Northern Territory conditions. DownunderRV Caravans manufacturer high quality caravans suited for WA and NT travelers, caravan park homes and mine workers at mining camps and mining towns of WA. Visit our big new and used <a href=\"http://webdesignmalaysia.net/caravan/index.php/contact/\">caravan display centre in Mandurah, near Perth</a>.&nbsp;</p><p>DownunderRV Caravan sales can tailor make or modify caravans to your specifications. Small single axle caravans, BIG tandem axle caravans, and Full Off-road Caravans sales WA and NT. <a href=\"http://webdesignmalaysia.net/caravan/index.php/downunder-rv/caravan-tips/\">Caravans tips.</a><br></p><p>Downunder RV sells caravans Western Australia wide and with a caravan sales company retail display shop in the Northern Territory of Australia, provides caravan sales and support to the Kimberley and northern Australia. <a href=\"http://webdesignmalaysia.net/caravan/index.php/downunder-rv/caravan-videos-western-australia/\">View presentation video.</a><br></p><p>New caravans sales Australia wide are covered by a 1 year warrantee by our after sales caravan service and repair team. <a href=\"http://webdesignmalaysia.net/caravan/index.php/downunder-rv/why-choose-us/\">Why choose us?</a><br></p><p>Visit our caravans sales office in Maundurah, south of the Swan River Perth, 100 Pinjarra Rd Mandurah ( opposite Ford) or our caravan sales agent in Broome and Darwin. <a href=\"/downunder-rv/latest-news\">Read our latest news.</a><br></p><p>Open MONDAY  FRIDAY 8.30  5pm, SATURDAY 8.30  4pm to see a range of caravans for sales and bargain caravan sales deals on selected caravan stock items and accessories.<br></p>', 'Downunder RV', '', 'inherit', 'open', 'open', '', '2907-revision-v1', '', '', '2015-06-17 10:47:23', '2015-06-17 10:47:23', '', '2907', 'http://webdesignmalaysia.net/caravan/index.php/2015/06/17/2907-revision-v1/', '0', 'revision', '', '0'),/*BUP_EOL*/('2956', '1', '2015-06-17 10:47:23', '2015-06-17 10:47:23', '<p>Downunder RVs owners Tom and Christine spent many years caravanning around Australia before they settled in Mandurah and established their very own caravan centre.\n\n</p><p>Here, they share some of their helpful caravanning tips to ensure you get the most out of your caravan touring Australia experience.&nbsp;If you have some additional caravanning tips youd like to share, feel free to <a href=\"http://webdesignmalaysia.net/caravan/index.php/contact/\">email them to us</a>.</p><p><span style=\"font-weight: bold;\">Packing Caravans</span><br>Its important when loading your caravan that you put the heaviest items on the bottom of the van, above the wheels in the middle of the caravan.\n\nLighter items should be stored at the top across the length of the caravan; while medium weighted items should be distributed in the middle and both ends evenly.\n\n</p><p><span style=\"font-weight: bold;\">Plugs</span><br>Its easy for plugs to go missing. If you attach a small chain from your plug to the sink youll never lose it again.\n\n</p><p><span style=\"font-weight: bold;\">Caravan Fire Risk</span><br>Dont risk ruining your holiday; keep your fire extinguisher on board caravans and up to date for peace of mind.\n\n</p><p><span style=\"font-weight: bold;\">BBQs</span><br>Save time when barbequing at caravan parks by using baking paper on the BBQ plate. When youre finished you can simply throw away the paper, leaving the plate clean.\n\n</p><p><span style=\"font-weight: bold;\">Safe Towing Caravans</span><br>Downunder RV always checks what tow vehicle you have to make sure you get the right weighted van to suit your vehicle. This is to ensure your vehicle is both legal on-road when towing caravans and for your safety.<br></p>', 'Caravan Tips', '', 'inherit', 'open', 'open', '', '2912-revision-v1', '', '', '2015-06-17 10:47:23', '2015-06-17 10:47:23', '', '2912', 'http://webdesignmalaysia.net/caravan/index.php/2015/06/17/2912-revision-v1/', '0', 'revision', '', '0'),/*BUP_EOL*/('2957', '1', '2015-06-17 10:47:23', '2015-06-17 10:47:23', '<div class=\"art-content-layout-wrapper layout-item-0\">\n<div class=\"art-content-layout\">\n    <div class=\"art-content-layout-row\">\n    <div class=\"art-layout-cell layout-item-1\" style=\"width: 100%\" >\n        <p>&lt;iframe width=\"1000\" height=\"350\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com.au/maps?f=q&amp;amp;source=embed&amp;amp;hl=en&amp;amp;geocode=&amp;amp;q=100+Pinjarra+Road,+Mandurah,+WA,+6210&amp;amp;aq=0&amp;amp;oq=100+Pinjarra+Road,+Mandurah+WA+6210&amp;amp;sll=-25.335448,135.745076&amp;amp;sspn=55.047272,107.138672&amp;amp;ie=UTF8&amp;amp;hq=&amp;amp;hnear=100+Pinjarra+Rd,+Mandurah+Western+Australia+6210&amp;amp;t=m&amp;amp;ll=-32.525757,115.72732&amp;amp;spn=0.025329,0.085831&amp;amp;z=14&amp;amp;iwloc=A&amp;amp;output=embed\"&gt;&lt;/iframe&gt;&lt;br /&gt;<br><small><a target=\"blank\" href=\"https://maps.google.com.au/