h quality caravans suited for WA and NT travelers, caravan park homes and mine workers at mining camps and mining towns of WA. Visit our big new and used caravan display centre in Mandurah, near Perth. DownunderRV Caravan sales can tailor make or modify caravans to your specifications. Small single axle caravans, BIG tandem axle caravans, and Full Off-road Caravans sales WA and NT.\n\n<img class=\"alignnone  wp-image-20\" alt=\"downunderrv-caravan2-large\" src=\"http://www.caravanperth.com/wp-content/uploads/2014/04/downunderrv-caravan2-large.jpg\" width=\"767\" height=\"421\" />\n\nDownunder RV sells caravans Western Australia wide and with a caravan sales company retail display shop in the Northern Territory of Australia, provides caravan sales and support to the Kimberley and northern Australia.\n\nNew caravans sales Australia wide are covered by a 1 year warrantee by our after sales caravan service and repair team.\n\nVisit our caravans sales office in Mandurah, south of the Swan River Perth, 100 Pinjarra Rd Mandurah ( opposite Ford) or our caravan sales agent in Broome and Darwin.\n\nOpen MONDAY  FRIDAY 8.30  5pm, SATURDAY 8.30  4pm to see a range of caravans for sales and bargain caravan sales deals on selected caravan stock items and accessories.\n\nDownunderRV\n100 Pinjarra Road, Mandurah WA 6210\nPhone: 08 9534 9466\n\nSite is being upgrade..', 'Caravan Sales Perth WA', '', 'publish', 'closed', 'open', '', 'caravan-sales-perth-wa', '', '', '2013-12-24 05:20:05', '2013-12-24 05:20:05', '', '0', 'http://http://www.caravanperth.com//?p=1', '0', 'post', '', '0'),/*BUP_EOL*/('2965', '1', '2014-04-15 10:18:00', '2014-04-15 10:18:00', '<img class=\"alignnone size-full wp-image-363\" alt=\"thumbs_dsc8251_1\" src=\"http://www.caravanperth.com/wp-content/uploads/2014/04/thumbs_dsc8251_1.jpg\" width=\"640\" height=\"480\" />\n\nThe New Patriot SE-L has raised the benchmark for quality and reliability in Off Road Caravanning throughout Australia. Limited only by its dimensions and weight to where this van can travel, this truly unique caravan is robust enough to endure the extreme Australian conditions while still providing quality creature comforts.\n\nMany of the optional extras offered on the SE model are standard on the SE-L, making the SE-L the best value in the Patriot range. It comes with everything you can expect with a 3 year Off Road manufacturers warranty and extras including an increased 800kg payload and an ATM of 3300kg.\n\nThe new chassis is high tech, super strong and extremely light with a 20 year Manufacturers warranty. The SE-L chassis now boasts a safety rating of 6.7 making it stronger, safer and lighter. 3.3 T Cruisemaster Independent Coil Suspension, a total of 8 shock absorbers\nand 16 alloy wheels makes the Patriot SEL a genuine Off Road Caravan.\n\n25mm insulation in the walls and ceiling and the insulation in the composite fiber glass floors keep the Patriot SE-L warm in winter and cool in Summer. For more extreme temperatures the reverse cycle air conditioner that is neatly perched on the ultra strong moulded fiberglass roof is simply switched on.\n\nThe 250 litre poly water tank and food grade soft pipe plumbing add protection from damaging stones when travelling off road. All wiring and plumbing is neatly tucked away emphasising attention to detail and allowing maximum cupboard space.\n\nComfort and security are only two of the fantastic attractions of the Patriot SE-L. Durability and quality is in abundance as well.\n\nThis is a truly unique caravan, tough enough to handle the extreme Australian conditions whilst providing quality creature comforts.\n\nStandard features such as the DVD/CD/MP3 Bluetooth Audio Unit and 22 LED TV ensures you are always entertained.\n\nThe supurb styling of the Patriot SE-L is a real head turner, putting it in a class of its own. A choice of modern 2pac or high quality timber cabinetry allows you to create the ambiance you desire in your caravan. The enviable en-suite has an abundance of room to move, with a large shower, plenty of storage and extensive lighting.\n\nTwo 200watt solar panels and two LIFe batteries guarantees the Patriot always has copious amounts of power.\n\nIsland and single bed configurations are available to suit the individuals needs and tastes. A tri-fold table is now available with a bed seat conversion that emphasizes the form and function of the new Patriot SE-L.\n\nPRICE ON APPLICATION\nPrice: $0.00\nLoading', 'Sunland Patriot SE-L', '', 'publish', 'closed', 'open', '', 'sunland-patriot-se-l', '', '', '2014-04-15 10:18:00', '2014-04-15 10:18:00', '', '0', 'http://www.caravanperth.com/?p=362', '0', 'post', '', '0'),/*BUP_EOL*/('2966', '1', '2014-04-15 10:22:22', '2014-04-15 10:22:22', '<img class=\"alignnone size-full wp-image-379\" alt=\"thumbs_dsc8312\" src=\"http://www.caravanperth.com/wp-content/uploads/2014/04/thumbs_dsc8312.jpg\" width=\"640\" height=\"480\" />\n\nSometimes referred to as the Rolls-Royce of caravans, when it comes to luxury vanning, Sunlands no-compromise approach to building caravans has put its Winton range on the radar of many RVers. Sunland is constantly working to improve the features, quality and style of its caravans, which keeps customers coming back.\n\nThe Winton is Sunlands latest update to its flagship range. Built on a solid chassis with independent suspension, its easy to see that this van is designed to go off the blacktop and explore some of Australias more remote areas. This adaptability of the Winton is very important to the team at Sunland, as they know that approximately 80% of Australias roads are still unsealed, and for those that really want to see all this land, they seek an RV with chassis and suspension that can take the hard knocks.\n\nThe Winton isnt all about tackling the tough dirt highways and development roads of the outback, but about how to it when you get there. So why dont we drop down the legs, roll out the awning, and find out why many regard the Winton as the king of the road.\nUnique Selling Points\n<ul>\n	<li>Heavy duty twin shock independent suspension.</li>\n	<li>Large ensuite with washing machine as standard.</li>\n	<li>Large array of power options as standard fitment.</li>\n	<li>Well thought-out and designed storage options.</li>\n	<li>Excellent free-camping ability.</li>\n</ul>\nPRICE ON APPLICATION\nPrice: $0.00', 'Sunland Winton', '', 'publish', 'closed', 'open', '', 'sunland-winton', '', '', '2014-04-15 10:22:22', '2014-04-15 10:22:22', '', '0', 'http://www.caravanperth.com/?p=378', '0', 'post', '', '0'),/*BUP_EOL*/('2967', '1', '2014-04-23 19:08:25', '2014-04-23 19:08:25', '<img class=\"alignnone size-full wp-image-832\" alt=\"SONY DSC\" src=\"http://www.caravanperth.com/wp-content/uploads/2014/04/DSC05909.jpg\" width=\"640\" height=\"360\" />\n\nUNIVERSAL Trailaway 21ft7 LUXURY Off Roader\n\nATM 3340 TARE 2940 BALL 160 S/N GG13045\n\nLeather Caf &amp; Full En Suite\n\nControl Rider Suspension, 16 Cooper tyres on Alloys,\nGalv Chassis &amp; Galv sheet under floor, D035 Hitch,\nReverse Camera &amp; Kit for car, IBIS A/C\nGrey Water Tank &amp; 2 x 86L Water Tanks,\n2 x Batteries &amp; 2 x Solars, Gas Bayonet for BBQ,\nLED Spotlights &amp; LEDs &amp; Courtesy lights,\nStoneguard, DBL Glazed Windows,\nExt HOLLYWOOD 32 TV Pack &amp; FUSION Radio &amp; Spkr Pack,\nUltra Modern Furniture with Griploc handles,\nFull oven under bench, M/Wave, Luxury Tapware,\nPlush Leather Caf , Q/S Inner Spring,\nWashing Machine &amp; Glass Vanity to En Suite\nand so much more.\n\nPRICE TO RE ORDER $ 92,990.00\n\nTHIS ONE ON SPECIAL !!\n\n$ 84,990.00', 'Universal Trailaway 21.7FT 2013 GG13045', '', 'publish', 'closed', 'open', '', 'universal-trailaway-21-7ft-2013-gg13045', '', '', '2014-04-23 19:08:25', '2014-04-23 19:08:25', '', '0', 'http://www.caravanperth.com/?p=831', '0', 'post', '', '0'),/*BUP_EOL*/('2968', '1', '2014-04-24 17:34:35', '2014-04-24 17:34:35', '<img class=\"alignnone size-full wp-image-859\" alt=\"S\